import { BrowserRouter, Routes, Route,Link } from "react-router-dom";
import Dashboard from "./Components/Shared/Dashboard";
import Layout from "./Components/Shared/Layout";
import Landing from "./Components/Shared/Landing";
import Admin from "./Components/Shared/Images/Styles/Admin";
import Applicant from "./Components/Shared/Images/Applicant/Applicant";
import Coordinator from "./Components/Shared/Images/Coordinator/Coordinator";
import Organization from "./Components/Shared/Images/Organization/Organization";
import Sidebar from "./Components/Shared/Sidebar";
function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={< Dashboard/>} /> 
      <Route index element={<Admin/>} />
      <Route path="/landing" element={<Applicant />} />
      <Route path="/layout" element={<Layout />} />
      <Route path="/coordi" element={<Coordinator />} />
      <Route path="/organization" element={<Organization />} />
      <Route path="/sidebar" element={<Sidebar />} />


    </Routes>
  </BrowserRouter>

  );
}

export default App;
